import React, { useState } from 'react';
import { PlusIcon, TrashIcon, MagnifyingGlassIcon } from '@heroicons/react/24/outline';
import { toast } from 'react-toastify';
import { searchFood, getNutritionInfo } from '../utils/api';

function MealTracker({ meals, onAddMeal, onRemoveMeal }) {
  const [searchTerm, setSearchTerm] = useState('');
  const [searchResults, setSearchResults] = useState([]);
  const [loading, setLoading] = useState(false);

  const handleSearch = async (query) => {
    if (!query || query.length < 2) {
      toast.info('Please enter at least 2 characters to search');
      setSearchResults([]);
      return;
    }

    setLoading(true);
    try {
      const results = await searchFood(query);
      setSearchResults(results || []);
      if (results?.length === 0) {
        toast.info('No food items found. Try a different search term.');
      }
    } catch (error) {
      // Only show error toast for network or server errors
      if (error.response?.status !== 404) {
        toast.error('Error searching for food items');
        console.error('Search error:', error);
      }
      setSearchResults([]);
    } finally {
      setLoading(false);
    }
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      e.preventDefault();
      handleSearch(searchTerm);
    }
  };

  const handleInputChange = (e) => {
    setSearchTerm(e.target.value);
    if (!e.target.value) {
      setSearchResults([]);
    }
  };

  const handleAddFood = async (food) => {
    try {
      const nutritionData = await getNutritionInfo(food.id);
      const mealWithNutrition = {
        ...food,
        nutrition: nutritionData
      };
      onAddMeal(mealWithNutrition);
      setSearchTerm('');
      setSearchResults([]);
      toast.success('Meal added successfully');
    } catch (error) {
      toast.error('Error adding meal');
      console.error('Add meal error:', error);
    }
  };

  return (
    <div className="bg-white rounded-lg shadow p-6">
      <h2 className="text-xl font-semibold mb-4">Track Your Meals</h2>
      
      {/* Search Bar */}
      <div className="mb-6">
        <div className="relative flex items-center">
          <input
            type="text"
            value={searchTerm}
            onChange={handleInputChange}
            onKeyPress={handleKeyPress}
            placeholder="Search for vegan food (min. 2 characters)..."
            className="w-full px-4 py-2 border border-gray-300 rounded-l-md focus:ring-2 focus:ring-primary-500 focus:border-transparent"
            disabled={loading}
          />
          <button
            onClick={() => handleSearch(searchTerm)}
            disabled={loading}
            className="px-4 py-2 bg-primary-600 text-white rounded-r-md hover:bg-primary-700 focus:outline-none focus:ring-2 focus:ring-primary-500 focus:ring-offset-2 disabled:opacity-50"
          >
            {loading ? (
              <div className="animate-spin rounded-full h-5 w-5 border-b-2 border-white"></div>
            ) : (
              <MagnifyingGlassIcon className="h-5 w-5" />
            )}
          </button>
        </div>

        {/* Search Results */}
        {searchResults.length > 0 && (
          <div className="mt-2 bg-white border border-gray-200 rounded-md shadow-lg max-h-60 overflow-y-auto">
            {searchResults.map((food) => (
              <div
                key={food.id}
                className="px-4 py-2 hover:bg-gray-50 flex items-center justify-between cursor-pointer"
                onClick={() => handleAddFood(food)}
              >
                <span>{food.name}</span>
                <PlusIcon className="h-5 w-5 text-primary-600" />
              </div>
            ))}
          </div>
        )}
      </div>

      {/* Meals List */}
      <div className="space-y-4">
        {meals.map((meal, index) => (
          <div
            key={`${meal.id}-${index}`}
            className="flex items-center justify-between bg-gray-50 p-4 rounded-md"
          >
            <div>
              <h3 className="font-medium">{meal.name}</h3>
              <p className="text-sm text-gray-600">
                {meal.nutrition.calories} kcal | Protein: {meal.nutrition.protein}g | 
                Carbs: {meal.nutrition.carbs}g | Fat: {meal.nutrition.fat}g
              </p>
            </div>
            <button
              onClick={() => onRemoveMeal(index)}
              className="text-red-600 hover:text-red-800"
            >
              <TrashIcon className="h-5 w-5" />
            </button>
          </div>
        ))}

        {meals.length === 0 && (
          <p className="text-center text-gray-500 py-4">
            No meals added yet. Start by searching for food above!
          </p>
        )}
      </div>
    </div>
  );
}

export default MealTracker;
